Claire Dames - Foreman's Funbags

Added: June 16, 2010

Claire is a bitchy, chauvinistic foreman on a construction site who works her employees to the bone. Her employees are scared of speaking up until one day Keiran can't take the harassment anymore and speaks out. Claire's impressed by Keiran's balls, but takes in him into her office none the less to show him who's boss!
